B.MK=A.a(s(["\n                    \u062c- \u0647\u0648 \u0645\u062d\u0645\u062f \u0628\u0646 \u0639\u0628\u062f \u0627\u0644\u0644\u0647 \u0628\u0646 \u0639\u0628\u062f \u0627\u0644\u0645\u0637\u0644\u0628 \u0628\u0646 \u0647\u0627\u0634\u0645 \u0648\u0647\u0627\u0634\u0645 \u0645\u0646 \u0642\u0631\u064a\u0634 \u0648\u0642\u0631\u064a\u0634 \u0645\u0646 \u0627\u0644\u0639\u0631\u0628 \u0648\u0627\u0644\u0639\u0631\u0628 \u0645\u0646 \u0630\u0631\u064a\u0629 \u0625\u0633\u0645\u0627\u0639\u064a\u0644 \u0648\u0625\u0633\u0645\u0627\u0639\u064a\u0644 \u0627\u0628\u0646 \u0625\u0628\u0631\u0627\u0647\u064a\u0645 \u0639\u0644\u064a\u0647 \u0648\u0639\u0644\u0649 \u0646\u0628\u064a\u0646\u0627 \u0623\u0641\u0636\u0644 \u0627\u0644\u0635\u0651\u064e\u0644\u0627\u0629 \u0648\u0627\u0644\u0633\u0651\u064e\u0644\u0627\u0645.                    ","\n                    \u062c- \u0622\u0645\u0646\u0629 \u0628\u0646\u062a \u0648\u0647\u0628.                    ","\n                    \u062c- \u062a\u0648\u0641\u064a \u0623\u0628\u0648\u0647 \u0641\u064a \u0627\u0644\u0645\u062f\u064a\u0646\u0629 \u0648\u0647\u0648 \u062d\u0645\u0644\u064c\u060c \u0644\u0645 \u064a\u0648\u0644\u062f \ufdfa .                    ","\n                    \u062c- \u0641\u064a \u0639\u0627\u0645 \u0627\u0644\u0641\u064a\u0644\u060c \u0641\u064a \u064a\u0648\u0645 \u0627\u0644\u0625\u062b\u0646\u064a\u0646 \u0645\u0646 \u0634\u0647\u0631 \u0631\u0628\u064a\u0639 \u0627\u0644\u0623\u0648\u0644.                    ","\n                    \u062c- \u0641\u064a \u0645\u0643\u0629.                    ","\n                    \u062c- \u0645\u0648\u0644\u0627\u0629 \u0623\u0628\u064a\u0647 \u0623\u0645 \u0623\u064a\u0645\u0646.\n- \u0645\u0648\u0644\u0627\u0629 \u0639\u0645\u0647 \u0623\u0628\u064a \u0644\u0647\u0628\u060c \u062b\u0648\u064a\u0628\u0629.\n- \u062d\u0644\u064a\u0645\u0629 \u0627\u0644\u0633\u0639\u062f\u064a\u0629.                    ","\n                    \u062c- \u062a\u0648\u0641\u064a\u062a \u0623\u0645\u0647 \u0648\u0647\u0648 \u0627\u0628\u0646 \u0633\u062a \u0633\u0646\u064a\u0646\u060c \u0648\u0643\u0641\u0644\u0647 \u062c\u062f\u0647 \u0639\u0628\u062f \u0627\u0644\u0645\u0637\u0644\u0628.                    ","\n                    \u062c- \u062a\u0648\u0641\u064a \u062c\u062f\u0647 \u0639\u0628\u062f \u0627\u0644\u0645\u0637\u0644\u0628 \u0648\u0647\u0648 \u0627\u0628\u0646 \u062b\u0645\u0627\u0646 \u0633\u0646\u064a\u0646\u060c \u0648\u0643\u0641\u0644\u0647 \u0639\u0645\u0647 \u0623\u0628\u0648 \u0637\u0627\u0644\u0628.                    ","\n                    \u062c- \u0633\u0627\u0641\u0631 \u0645\u0639 \u0639\u0645\u0647 \u0625\u0644\u0649 \u0627\u0644\u0634\u0627\u0645 \u0648\u0639\u0645\u0631\u0647 \u0627\u062b\u0646\u0627 \u0639\u0634\u0631 \u0633\u0646\u0629.                    ","\n                    \u062c- \u0643\u0627\u0646 \u0633\u0641\u0631\u0647 \u0627\u0644\u062b\u0627\u0646\u064a \u0641\u064a \u062a\u062c\u0627\u0631\u0629 \u0628\u0645\u0627\u0644 \u062e\u062f\u064a\u062c\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627\u060c \u0648\u0644\u0645\u0651\u064e\u0627 \u0631\u062c\u0639 \u062a\u0632\u0648\u062c\u0647\u0627 \ufdfa \u060c \u0648\u0644\u0647 \u0645\u0646 \u0627\u0644\u0639\u0645\u0631 \u062e\u0645\u0633 \u0648\u0639\u0634\u0631\u0648\u0646 \u0633\u0646\u0629.                    ","\n                    \u062c- \u0623\u0639\u0627\u062f\u062a \u0642\u0631\u064a\u0634 \u0628\u0646\u0627\u0621 \u0627\u0644\u0643\u0639\u0628\u0629\u060c \u0648\u0644\u0647 \u0645\u0646 \u0627\u0644\u0639\u0645\u0631 \u062e\u0645\u0633 \u0648\u062b\u0644\u0627\u062b\u0648\u0646 \u0633\u0646\u0629.\n\u0648\u062d\u064e\u0643\u0651\u064e\u0645\u0648\u0647 \u0644\u0645\u0651\u064e\u0627 \u0627\u062e\u062a\u0644\u0641\u0648\u0627 \u0641\u064a \u0645\u0646 \u064a\u0636\u0639 \u0627\u0644\u062d\u062c\u0631 \u0627\u0644\u0623\u0633\u0648\u062f\u060c \u0641\u0648\u0636\u0639\u0647 \u0641\u064a \u062b\u0648\u0628\u060c \u0648\u0623\u0645\u0631 \u0643\u0644 \u0642\u0628\u064a\u0644\u0629 \u0623\u0646 \u062a\u0623\u062e\u0630 \u0628\u0637\u0631\u0641 \u0645\u0646 \u0627\u0644\u062b\u0648\u0628\u060c \u0648\u0643\u0627\u0646\u0648\u0627 \u0623\u0631\u0628\u0639 \u0642\u0628\u0627\u0626\u0644\u060c \u0641\u0644\u0645\u0627 \u0631\u0641\u0639\u0648\u0647 \u0625\u0644\u0649 \u0645\u0648\u0636\u0639\u0647\u060c \u0648\u0636\u0639\u0647 \u0628\u064a\u062f\u0647 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.                    ","\n                    \u062c- \u0643\u0627\u0646 \u0639\u0645\u0631\u0647 \u0623\u0631\u0628\u0639\u064a\u0646 \u0633\u0646\u0629\u060c \u0648\u0628\u0639\u062b \u0625\u0644\u0649 \u0627\u0644\u0646\u0627\u0633 \u0643\u0627\u0641\u0629 \u0628\u0634\u064a\u0631\u064b\u0627 \u0648\u0646\u0630\u064a\u0631\u064b\u0627.                    ","\n                    \u062c- \u0627\u0644\u0631\u0624\u064a\u0629 \u0627\u0644\u0635\u0627\u062f\u0642\u0629\u060c \u0641\u0643\u0627\u0646 \u0644\u0627 \u064a\u0631\u0649 \u0631\u0624\u064a\u0627 \u0625\u0644\u0627 \u062c\u0627\u0621\u062a \u0645\u062b\u0644 \u0641\u0644\u0642 \u0627\u0644\u0635\u0628\u062d.                    ","\n                    \u062c- \u0643\u0627\u0646 \u064a\u062a\u0639\u0628\u062f \u0644\u0644\u0647 \u0641\u064a \u063a\u0627\u0631 \u062d\u0631\u0627\u0621 \u0648\u064a\u062a\u0632\u0648\u062f \u0644\u0630\u0644\u0643.\n\u0648\u0646\u0632\u0644 \u0639\u0644\u064a\u0647 \u0627\u0644\u0648\u062d\u064a\u060c \u0648\u0647\u0648 \u0641\u064a \u0627\u0644\u063a\u0627\u0631 \u064a\u062a\u0639\u0628\u062f.                    ","\n                    \u062c- \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0671\u0642\u06e1\u0631\u064e\u0623\u06e1 \u0628\u0650\u0671\u0633\u06e1\u0645\u0650 \u0631\u064e\u0628\u0651\u0650\u0643\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a \u062e\u064e\u0644\u064e\u0642\u064e 1 \u062e\u064e\u0644\u064e\u0642\u064e \u0671\u0644\u06e1\u0625\u0650\u0646\u0633\u064e\u0640\u0646\u064e \u0645\u0650\u0646\u06e1 \u0639\u064e\u0644\u064e\u0642\u064d 2 \u0671\u0642\u06e1\u0631\u064e\u0623\u06e1 \u0648\u064e\u0631\u064e\u0628\u0651\u064f\u0643\u064e \u0671\u0644\u06e1\u0623\u064e\u0643\u06e1\u0631\u064e\u0645\u064f 3 \u0671\u0644\u0651\u064e\u0630\u0650\u064a \u0639\u064e\u0644\u0651\u064e\u0645\u064e \u0628\u0650\u0671\u0644\u06e1\u0642\u064e\u0644\u064e\u0645\u0650 4 \u0639\u064e\u0644\u0651\u064e\u0645\u064e \u0671\u0644\u06e1\u0625\u0650\u0646\u0633\u064e\u0640\u0646\u064e \u0645\u064e\u0627 \u0644\u064e\u0645\u06e1 \u064a\u064e\u0639\u06e1\u0644\u064e\u0645\u06e1 5\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0639\u0644\u0642: 1 - 5].                    ","\n                    \u062c- \u0645\u0646 \u0627\u0644\u0631\u062c\u0627\u0644: \u0623\u0628\u0648 \u0628\u0643\u0631 \u0627\u0644\u0635\u062f\u064a\u0642\u060c \u0648\u0645\u0646 \u0627\u0644\u0646\u0633\u0627\u0621: \u062e\u062f\u064a\u062c\u0629 \u0628\u0646\u062a \u062e\u0648\u064a\u0644\u062f\u060c \u0648\u0645\u0646 \u0627\u0644\u0635\u0628\u064a\u0627\u0646: \u0639\u0644\u064a \u0628\u0646 \u0623\u0628\u064a \u0637\u0627\u0644\u0628\u060c \u0648\u0645\u0646 \u0627\u0644\u0645\u0648\u0627\u0644\u064a: \u0632\u064a\u062f \u0628\u0646 \u062d\u0627\u0631\u062b\u0629\u060c \u0648\u0645\u0646 \u0627\u0644\u0623\u0631\u0642\u0627\u0621: \u0628\u0644\u0627\u0644 \u0627\u0644\u062d\u0628\u0634\u064a \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u0645\u060c \u0648\u063a\u064a\u0631\u0647\u0645.                    ","\n                    \u062c- \u0643\u0627\u0646\u062a \u0627\u0644\u062f\u0639\u0648\u0629 \u0633\u0631\u0651\u064b\u0627 \u0646\u062d\u0648 \u062b\u0644\u0627\u062b \u0633\u0646\u064a\u0646\u060c \u062b\u0645 \u0623\u0645\u0631 \ufdfa \u060c \u0628\u0627\u0644\u062c\u0647\u0631 \u0628\u0627\u0644\u062f\u0639\u0648\u0629.                    ","\n                    \u062c- \u0628\u0627\u0644\u063a \u0627\u0644\u0645\u0634\u0631\u0643\u0648\u0646 \u0641\u064a \u0623\u0630\u064a\u062a\u0647 \u0648\u0623\u0630\u064a\u0629 \u0627\u0644\u0645\u0633\u0644\u0645\u064a\u0646\u060c \u062d\u062a\u0649 \u0623\u0630\u0646 \u0644\u0644\u0645\u0624\u0645\u0646\u064a\u0646 \u0628\u0627\u0644\u0647\u062c\u0631\u0629 \u0625\u0644\u0649 \u0627\u0644\u0646\u062c\u0627\u0634\u064a \u0641\u064a \u0627\u0644\u062d\u0628\u0634\u0629.\n\u0648\u0623\u062c\u0645\u0639 \u0623\u0647\u0644 \u0627\u0644\u0634\u0631\u0643 \u0639\u0644\u0649 \u0623\u0630\u064a\u0629 \u0648\u0642\u062a\u0644 \u0627\u0644\u0646\u0628\u064a \ufdfa \u060c \u0641\u062d\u0645\u0627\u0647 \u0627\u0644\u0644\u0647 \u0648\u0623\u062d\u0627\u0637\u0647 \u0628\u0639\u0645\u0647 \u0623\u0628\u0648 \u0637\u0627\u0644\u0628 \u0644\u064a\u062d\u0645\u064a\u0647 \u0645\u0646\u0647\u0645.                    ","\n                    \u062c- \u062a\u0648\u0641\u064a \u0639\u0645\u0647 \u0623\u0628\u0648 \u0637\u0627\u0644\u0628\u060c \u0648\u0632\u0648\u062c\u062a\u0647 \u062e\u062f\u064a\u062c\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.                    ","\n                    \u062c- \u0643\u0627\u0646 \u0641\u064a \u0627\u0644\u062e\u0645\u0633\u064a\u0646 \u0645\u0646 \u0639\u0645\u0631\u0647\u060c \u0648\u0641\u0631\u0636\u062a \u0639\u0644\u064a\u0647 \u0627\u0644\u0635\u0644\u0648\u0627\u062a \u0627\u0644\u062e\u0645\u0633.\n\u0627\u0644\u0625\u0633\u0631\u0627\u0621: \u0645\u0646 \u0627\u0644\u0645\u0633\u062c\u062f \u0627\u0644\u062d\u0631\u0627\u0645 \u0625\u0644\u0649 \u0627\u0644\u0645\u0633\u062c\u062f \u0627\u0644\u0623\u0642\u0635\u0649.\n\u0648\u0627\u0644\u0645\u0639\u0631\u0627\u062c: \u0643\u0627\u0646 \u0645\u0646 \u0627\u0644\u0645\u0633\u062c\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0625\u0644\u0649 \u0627\u0644\u0633\u0645\u0627\u0621 \u0625\u0644\u0649 \u0633\u062f\u0631\u0629 \u0627\u0644\u0645\u0646\u062a\u0647\u0649.                    ","\n                    \u062c- \u0643\u0627\u0646 \u064a\u062f\u0639\u0648 \u0623\u0647\u0644 \u0627\u0644\u0637\u0627\u0626\u0641\u060c \u0648\u064a\u0639\u0631\u0636 \u0646\u0641\u0633\u0647 \u0641\u064a \u0627\u0644\u0645\u0648\u0627\u0633\u0645 \u0648\u0645\u062c\u0627\u0645\u0639 \u0627\u0644\u0646\u0627\u0633\u060c \u062d\u062a\u0649 \u062c\u0627\u0621 \u0623\u0647\u0644 \u0627\u0644\u0645\u062f\u064a\u0646\u0629 \u0645\u0646 \u0627\u0644\u0623\u0646\u0635\u0627\u0631\u060c \u0641\u0622\u0645\u0646\u0648\u0627 \u0628\u0627\u0644\u0646\u0628\u064a \ufdfa \u060c \u0648\u0628\u0627\u064a\u0639\u0648\u0647 \u0639\u0644\u0649 \u0646\u0635\u0631\u062a\u0647.                    ","\n                    \u062c- \u0628\u0642\u064a \u062b\u0644\u0627\u062b \u0639\u0634\u0631\u0629 \u0633\u0646\u0629.                    ","\n                    \u062c- \u0645\u0646 \u0645\u0643\u0629 \u0625\u0644\u0649 \u0627\u0644\u0645\u062f\u064a\u0646\u0629.                    ","\n                    \u062c- \u0639\u0634\u0631 \u0633\u0646\u064a\u0646.                    ","\n                    \u062c- \u0641\u0631\u0636 \u0639\u0644\u064a\u0647 \u0627\u0644\u0632\u0643\u0627\u0629\u060c \u0648\u0627\u0644\u0635\u064a\u0627\u0645\u060c \u0648\u0627\u0644\u062d\u062c\u060c \u0648\u0627\u0644\u062c\u0647\u0627\u062f\u060c \u0648\u0627\u0644\u0623\u0630\u0627\u0646\u060c \u0648\u063a\u064a\u0631\u0647\u0627 \u0645\u0646 \u0634\u0631\u0627\u0626\u0639 \u0627\u0644\u0625\u0633\u0644\u0627\u0645.                    ","\n                    \u062c- \u063a\u0632\u0648\u0629 \u0628\u062f\u0631 \u0627\u0644\u0643\u0628\u0631\u0649.\n\u063a\u0632\u0648\u0629 \u0623\u062d\u062f.\n\u063a\u0632\u0648\u0629 \u0627\u0644\u0623\u062d\u0632\u0627\u0628.\n\u063a\u0632\u0648\u0629 \u0641\u062a\u062d \u0645\u0643\u0629.                    ","\n                    \u062c- \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627 \u064a\u0648\u06e1\u0645\u064b\u0627 \u062a\u064f\u0631\u06e1\u062c\u064e\u0639\u064f\u0648\u0646\u064e \u0641\u0650\u064a\u0647\u0650 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650\u06d6 \u062b\u064f\u0645\u0651\u064e \u062a\u064f\u0648\u064e\u0641\u0651\u064e\u0649 \u0643\u064f\u0644\u0651\u064f \u0646\u064e\u0641\u06e1\u0633\u064d \u0645\u0651\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064e\u062a\u06e1 \u0648\u064e\u0647\u064f\u0645\u06e1 \u0644\u064e\u0627 \u064a\u064f\u0638\u06e1\u0644\u064e\u0645\u064f\u0648\u0646\u064e 281\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: 281].                    ","\n                    \u062c- \u062a\u0648\u0641\u064a \u0641\u064a \u0634\u0647\u0631 \u0631\u0628\u064a\u0639 \u0627\u0644\u0623\u0648\u0644\u060c \u0645\u0646 \u0627\u0644\u0633\u0646\u0629 \u0627\u0644\u062d\u0627\u062f\u064a\u0629 \u0639\u0634\u0631\u0629 \u0645\u0646 \u0627\u0644\u0647\u062c\u0631\u0629\u060c \u0648\u0644\u0647 \u0645\u0646 \u0627\u0644\u0639\u0645\u0631 \u062b\u0644\u0627\u062b \u0648\u0633\u062a\u0648\u0646 \u0633\u0646\u0629.                    ","\n                    \u062c- \u0661- \u062e\u062f\u064a\u062c\u0629 \u0628\u0646\u062a \u062e\u0648\u064a\u0644\u062f \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.\n\u0662- \u0633\u0648\u062f\u0629 \u0628\u0646\u062a \u0632\u0645\u0639\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.\n\u0663- \u0639\u0627\u0626\u0634\u0629 \u0628\u0646\u062a \u0623\u0628\u064a \u0628\u0643\u0631 \u0627\u0644\u0635\u062f\u064a\u0642 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.\n\u0664- \u062d\u0641\u0635\u0629 \u0628\u0646\u062a \u0639\u0645\u0631 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627\n\u0665- \u0632\u064a\u0646\u0628 \u0628\u0646\u062a \u062e\u0632\u064a\u0645\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.\n\u0666- \u0623\u0645 \u0633\u0644\u0645\u0629 \u0647\u0646\u062f \u0628\u0646\u062a \u0623\u0628\u064a \u0623\u0645\u064a\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.\n\u0667- \u0623\u0645 \u062d\u0628\u064a\u0628\u0629 \u0631\u0645\u0644\u0629 \u0628\u0646\u062a \u0623\u0628\u064a \u0633\u0641\u064a\u0627\u0646 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.\n\u0668- \u062c\u0648\u064a\u0631\u064a\u0629 \u0628\u0646\u062a \u0627\u0644\u062d\u0627\u0631\u062b \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627\n\u0669- \u0645\u064a\u0645\u0648\u0646\u0629 \u0628\u0646\u062a \u0627\u0644\u062d\u0627\u0631\u062b \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627.\n\u0661\u0660- \u0635\u0641\u064a\u0629 \u0628\u0646\u062a \u062d\u064a\u064a \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627\n\u0661\u0661- \u0632\u064a\u0646\u0628 \u0628\u0646\u062a \u062c\u062d\u0634 \u0631\u0636\u064a \u0627\u0644\u0644\u0647 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627                    ","\n                    \u062c- \u0645\u0646 \u0627\u0644\u0630\u0643\u0648\u0631 \u062b\u0644\u0627\u062b\u0629:\n\u0627\u0644\u0642\u0627\u0633\u0645\u060c \u0648\u0628\u0647 \u0643\u0627\u0646 \u064a\u0643\u0646\u0649.\n\u0648\u0639\u0628\u062f \u0627\u0644\u0644\u0647.\n\u0648\u0625\u0628\u0631\u0627\u0647\u064a\u0645.\n\u0645\u0646 \u0627\u0644\u0625\u0646\u0627\u062b:\n\u0641\u0627\u0637\u0645\u0629.\n\u0631\u0642\u064a\u0629.\n\u0623\u0645 \u0643\u0644\u062b\u0648\u0645.\n\u0632\u064a\u0646\u0628.\n\u0648\u0643\u0644 \u0648\u0644\u062f\u0647 \u0645\u0646 \u062e\u062f\u064a\u062c\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627\u060c \u0625\u0644\u0627 \u0625\u0628\u0631\u0627\u0647\u064a\u0645\u060c \u0648\u0643\u0644\u0647\u0645 \u0645\u0627\u062a \u0642\u0628\u0644\u0647 \u0625\u0644\u0627 \u0641\u0627\u0637\u0645\u0629 \u0628\u0639\u062f\u0647 \u0628\u0633\u062a\u0629 \u0623\u0634\u0647\u0631.                    ","\n                    \u062c- \u0643\u0627\u0646 \ufdfa \u0648\u0633\u0637\u064b\u0627 \u0645\u0646 \u0627\u0644\u0631\u062c\u0627\u0644 \u0644\u064a\u0633 \u0628\u0627\u0644\u0642\u0635\u064a\u0631 \u0648\u0644\u0627 \u0628\u0627\u0644\u0637\u0648\u064a\u0644 \u0628\u0644 \u0628\u064a\u0646 \u0630\u0644\u0643\u060c \u0648\u0643\u0627\u0646 \u0623\u0628\u064a\u0636 \u0645\u0634\u0631\u0628\u064b\u0627 \u0628\u0627\u0644\u062d\u0645\u0631\u0629 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f\u060c \u0648\u0643\u0627\u0646 \u0643\u062b\u064a\u0641 \u0627\u0644\u0644\u062d\u064a\u0629\u060c \u0648\u0627\u0633\u0639 \u0627\u0644\u0639\u064a\u0646\u064a\u0646\u060c \u0639\u0638\u064a\u0645 \u0627\u0644\u0641\u0645\u060c \u0634\u0639\u0631\u0647 \u0634\u062f\u064a\u062f \u0627\u0644\u0633\u0648\u0627\u062f\u060c \u0639\u0638\u064a\u0645 \u0627\u0644\u0645\u0646\u0643\u0628\u064a\u0646 \u0637\u064a\u0628 \u0627\u0644\u0631\u0627\u0626\u062d\u0629 \u0648\u063a\u064a\u0631 \u0630\u0644\u0643 \u0645\u0646 \u062e\u0644\u0642\u062a\u0647 \u0627\u0644\u062c\u0645\u064a\u0644\u0629 \ufdfa .                    ","\n                    \u062c- \u062a\u0631\u0643 \u0623\u0645\u062a\u0647 \ufdfa \u0639\u0644\u0649 \u0627\u0644\u0645\u062d\u062c\u0629 \u0627\u0644\u0628\u064a\u0636\u0627\u0621\u060c \u0644\u064a\u0644\u0647\u0627 \u0643\u0646\u0647\u0627\u0631\u0647\u0627\u060c \u0644\u0627 \u064a\u0632\u064a\u063a \u0639\u0646\u0647\u0627 \u0625\u0644\u0627 \u0647\u0627\u0644\u0643\u060c \u0645\u0627 \u062a\u0631\u0643 \u062e\u064a\u0631\u064b\u0627 \u0625\u0644\u0627 \u062f\u0644 \u0627\u0644\u0623\u0645\u0629 \u0639\u0644\u064a\u0647\u060c \u0648\u0644\u0627 \u0634\u0631\u0651\u064b\u0627 \u0625\u0644\u0627 \u062d\u0630\u0631\u0647\u0627 \u0645\u0646\u0647.                    "]),t.s)
